【カリー屋カレー 甘口の詳細】<br>
●オリジナルにブレンドした29種類のスパイス、野菜、ブイヨンをじっくり煮込んだ、人気の洋食屋のカレーです。<br>
●デミグラスソースの味わいと炒め玉ねぎの甘さと香りをアップさせ、お子さまから大人まで満足できるコク重視の「カレー専門店のような甘口」を実現しました。<br>
●ハウス独自の新製法「香味アップ製法」で、選び抜いたスパイスが持つ香味を最大限に引き出し、カレーの香りとコクのアップを実現しました。<br><br>

【作り方】<br>
●中袋(レトルトパウチ)の封を切らずに、熱湯の中に入れ、3～5分沸騰させます。<br>
●電子レンジの場合：必ず深めの皿に移し替えてラップをかけて温めます。<br>
※中袋のまま電子レンジには入れないでください。<br>
※加熱時間は、機種・W(ワット)数により異なりますので、加減してください。<br>
※開封した際に水分が分離している場合がありますが、品質に問題はありません。<br>
※冷蔵庫など温度の低い場所で保存すると水分が分離しやすくなります。<br><br>

【ご注意】<br>
○やけどに注意。ラップを取る際には、顔を近づけないでください。<br>
○中袋の開封後は1回で使いきってください。未開封であれば、もう一度温め直しても召しあがれます。<br>
○この製品はレトルトパウチ食品ですので、保存料は使用しておりません。室温で長期間保存できます。<br><br>

【原材料】<br>
野菜(じゃがいも、にんじん)、小麦粉、牛脂豚脂混合油、牛肉、砂糖、トマトペースト、カレーパウダー、食塩、ココナッツペースト、ソテーオニオン、ぶどう糖、でんぷん、酵母エキス、りんごペースト、しょう油、香辛料、オニオンパウダー、ガーリックパウダー、チキンブイヨン、調味料(アミノ酸等)、カラメル色素、酸味料、香料、(原材料の一部に乳成分を含む)<br><br>

【栄養成分】1人分(200g)あたり<br>
