鶏肉、牛脂豚脂混合油、小麦粉、粒状植物性たん白、トマトペースト、砂糖・ぶどう糖果糖液糖、香辛料、しょうが、カレーパウダー、食塩、乾燥玉ねぎ、ガーリックペースト、しょう油、でんぷん、酵母エキス、オニオンパウダー、ガーリックパウダー、発酵調味料、チキンブイヨン、調味料(アミノ酸等)、カラメル色素、酸味料、香料、甘味料(スクラロース)<br><br>

